import React from 'react'

const Footer = () => {
    return (
        <footer className='row p-5 justify-content-center mx-0 '>
             
             <div className="col-auto">    
                        <h3>
                             2020 iconsquare All rights reserved
                         </h3>
             </div>             
             <style jsx> {`
                      footer {
                          background:rgba(0,0,0,0.7);
                          color:white;
                          margin-top:10%;                          
                      }  
                      h3 {
                          font-size:2rem;
                      }
                        `}
              </style>
        </footer>
    )
}

export default Footer
